Paige.create({ name: "Paige Kiefner", bio:"Paige Marie, 27, is a graduate of the Eastman School of Music in Rochester, NY, and currently pursuing a Master’s Degree at the University of Missouri Kansas-City. Recently, she appeared as a guest artist in University of Oregon’s production of Le nozze di Figaro as Susanna, and in Aquilon Music Festival’s production of La chûte du Phaëton as Climene. She has also appeared in the Eastman School of Music’s production of Ned Rorem’s Our Town as Emily Webb, Dialogues of the Carmelites, She Loves Me, and Street Scene, Roberts Wesleyan’s production of West Side Story as Maria, and the Rochester Lyric Opera’s  production of The Tales of Custard the Dragon and Little Red’s Most Unusual Day. Her specialties include late Italian Romantic opera, German Lied, and American opera. When not performing or coding, Paige Marie loves to hike, camp, and explore the outdoors. She is from Cape Girardeau, MO.", video: [{ title: "Frühlingsfeier", link: "https://www.youtube.com/embed/9GXO5DYPyfA"}, {title: "", link: "https://youtu.be/A5GfKw-wcH8"}, {title:"", link: "https://youtu.be/bsTlBhNQw4A"}], photos: ["https://scontent.fcou1-1.fna.fbcdn.net/v/t1.0-9/15193420_10211097156892963_2950914862222270713_n.jpg?_nc_cat=107&_nc_oc=AQkcXm_5IYB6Gu9VdhNobY-Lu1VEs9CghL7_LGMEubTdr7ibXg-C9nIiaVBHkgGWDMs&_nc_ht=scontent.fcou1-1.fna&oh=d58e6cef279d8e1a2792ba41b1ac6d0b&oe=5DF0B6BD", "https://scontent.fcou1-1.fna.fbcdn.net/v/t1.0-9/17203094_10212172178607834_5566685237879786899_n.jpg?_nc_cat=104&_nc_oc=AQmdusSdnqqeSeNbOezb-VmCzlLpANsaU7TGU5a-0yvUW8Kh3W6cSJI03w-6BGc3o8o&_nc_ht=scontent.fcou1-1.fna&oh=371318394f74f39544531a159d2d3f53&oe=5DFF0CE7", "https://scontent.fcou1-1.fna.fbcdn.net/v/t1.0-9/12036876_10103050453892768_1769943473496403352_n.jpg?_nc_cat=102&_nc_oc=AQlel4qcGt3Y54G_S0Y1YiYhdMflU9AJMKySykCAQp-CU58OClMt7FC6wWprMDogXH8&_nc_ht=scontent.fcou1-1.fna&oh=81a37689eb58c87c55216e959cbd2576&oe=5E022C37", "https://scontent.fcou1-1.fna.fbcdn.net/v/t1.0-9/11219109_10204308471773427_5613221134092652472_n.jpg?_nc_cat=108&_nc_oc=AQmR2F-32JBXVHFRKs5JSoZpPnEiI2777ql48v8bn7bimEqSB5h2q3PV7MdJ8LwP5Ck&_nc_ht=scontent.fcou1-1.fna&oh=71181bb088d6ae9a8c810457a240a03b&oe=5E01A9D4"], recording: [], outside_source_link: [], specialties: ["Italian Opera", "American Opera", "German Romantic Lieder", "Early Music", "Sacred Choral Music"]})

Paige.create({ name: "Paige Kiefner, aka paigethefriendlydragon", bio: "I am a Junior Full-Stack Developer and recently completed my apprenticeship at Launch Academy, Inc, based in Boston, MA. Currently I am attending graduate school at the University of Missouri Kansas City, for a Masters of Music. While I am still an actively working classical singer, I am seeking a new challenge and would like to be a junior developer at a great company that is making a difference in the world! My past experience in music, as well as my experience in sales and management have made me eager for every challenge that comes my way, and I have found that so many of those skills are applicable and desired in the developer environment. On a personal note, I love adventure, and have an indomitable spirit!", video: [], photos: [], outside_source_link: ["https://github.com/paigiethefriendlydragon"], specialties: ["ruby", "javascript", "rails", "react", "html", "css"] })
